Explicación: Este soneto es claramente obra de Francisco de Quevedo, un importante poeta barroco español del siglo XVII, conocido por su estilo conceptista y su ingenio poético. El poema presenta características típicas de su estilo, con un juego metafórico complejo y un uso intenso de la paradoja.
